import React, { Component } from "react";
import Ticket from "./../images/movie_tickets.jpg";
import "./Home.css";

export default class Home extends Component {
  render() {
    return (
      <div className="text-center">
        <h2>This is the home page</h2>
        <hr />

        <div class="twp-video-background">
          <div class="twp-video-foreground">
            <iframe
              src="https://www.youtube.com/embed/dQiYnFQX3Qg?controls=0&showinfo=0&rel=0&autoplay=1&loop=1&playlist=WLHTWG-UmQ&mute=1"
              frameborder="0"
              allowfullscreen
              allow="autoplay"
            ></iframe>
          </div>
          <div class="twp-video-layer"></div>
        </div>
      </div>
    );
  }
}
